import React, { Component } from 'react'

export class Header extends Component {
  render() {
    return (
      <div>
        <nav className="navbar navbar-light bg-light">
            <a className="navbar-brand" href="#">Navbar</a>
        </nav>
      </div>
    )
  }
}

export default Header
